public class GoalKeeper extends Player {

    private int goloSofrido;

    public GoalKeeper(String name, int num) {
        super(name, num);
        goloSofrido = 0;
    }

    public void incGolosSofridos() {
        goloSofrido++;
    }

    public int getGoloSofrido() {
        return goloSofrido;
    }

    @Override
    public String toString() {
        return "GuardaRedes{" +
                "name='" + super.getName() + '\'' +
                ", num=" + getNum() +
                ", goloMarcado=" + golosMarcados() +
                ", goloSofrido=" + goloSofrido +
                '}';
    }
}
